import React from 'react';
import './Home.css'; // Import your CSS file
import { Link } from 'react-router-dom';
import { TopicBox } from '../components/TopicBox';

export default function Home() {
  return (
    <div className="container">

      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="logo">Smart Care</div>
        <ul className="nav-links">
          <li><Link to="/Home" className="nav-link">Home</Link></li>
          <li><Link to="/Aboutus" className="nav-link">About Us</Link></li>
          <li><Link to="/Contactus" className="nav-link">Contact Us</Link></li>
          <li><Link to="/Careers" className="nav-link">Careers</Link></li>
        </ul>
      </nav>

      {/* Buttons */}
      <div className="button-container">
        <button className="button" onClick={() => alert('Emergency 011-32144578')}>Emergency</button>
        <button className="button" onClick={() => alert('Make an appointment')}>Appointment</button>
      </div>

      {/* TopicBox */}
      <div>
        <TopicBox />
      </div>
    </div>
  );
}
